calculation.formula:
// Divide earnings by FTE and multiply by 12 to get an annualized earnings
// per employee FTE

(sum([GROSS_EARNINGS_PAY_PER])/sum([TIME_DISTRIB_ACTUAL])) *12

// There are sometimes issues with how the campuses encode their data for location_3, which is what we use // to track those in the UC health umberella. To remedy this, one can look at the org_1_code and org_1_title //fields to see if there were errors. In the cases below, we could tell location_3 was not correct by looking //at the org_1 titles. If an org title indicated a medical school or some other health science area and it was // categorized into general campus, we capture that and make sure it correctly categorized into health
// Fixes for Irvine
IF [LOCATION_3] = '2' THEN 'UC Health' ELSEIF ([LOCATION_3] = '1' AND [LOCATION_1] = '09') AND ((RTRIM([ORG_1_CODE]) = '99030') OR (RTRIM([ORG_1_CODE]) = '9MEDC') OR (RTRIM([ORG_1_CODE]) = '92000')) THEN 'UC Health'
// Fixes for Riverside ELSEIF ([LOCATION_3] = '1' AND [LOCATION_1] = '05' AND RTRIM([ORG_1_CODE]) = '5ORG40') THEN 'UC Health'
// Fixes for Los Angeles ELSEIF ([LOCATION_3] = '1' AND [LOCATION_1] = '04') AND ((RTRIM([ORG_1_CODE]) = '44000') OR (RTRIM([ORG_1_CODE]) = '42200') OR (RTRIM([ORG_1_CODE]) = '43200')) THEN 'UC Health'
// Fixes for San Diego ELSEIF ([LOCATION_3] = '1' AND [LOCATION_1] = '06') AND ((RTRIM([ORG_1_CODE]) = '6000003') OR (RTRIM([ORG_1_CODE]) = '6 3') OR (RTRIM([ORG_1_CODE]) = '6000005') OR (RTRIM([ORG_1_CODE]) = '6 5') OR (RTRIM([ORG_1_CODE]) = '60003') OR (RTRIM([ORG_1_CODE]) = '60008') OR (RTRIM([ORG_1_CODE]) = '6000008') OR (RTRIM([ORG_1_CODE]) = '60005') ) THEN 'UC Health'
ELSE 'General Campus'
END

// Filters for only 'base FTE'


//Applies fix for those at Irvine who received retro-active pay adjustments that were encoded with 1.0 FTE
// when they should have had 0.0 FTE. We foudn all of the check dates were on the same day and so this allows
// us to remove the FTE from those lines while retaining the associated pay.
IF [LOCATION_1] = '09' AND [CHECK_DATE] = DATE('12/1/2015') THEN 0


ELSEIF [Calculation_1016687669560307714] = 'Base FTE' THEN [TIME_DISTRIB_ACTUAL]
END

// This categorizes employees into a more ganular version of personnel program. Particularly, it breaks
// managers out from senior professionals in the MSP personnel program. It also breaks students out from the
// large PSS personnel program. 
// For several years some employees were miscategorized with the CTO of M05, which is used for those in the
// SMG personnel program when they should have been in the 'Managers' CTO of M10, line 5 below fixes this.

IF [PERS_PGM] = 'ACA' THEN 'Academics'
ELSEIF [Calculation_946318925060980737] = '4' THEN 'Student Staff'
ELSEIF [PERS_PGM] = 'SMG' THEN 'SMG'
ELSEIF [CTO_FIX] = 'M10' THEN 'MSP - Managers'
ELSEIF [PERS_PGM] = 'MSP' AND [CTO_FIX] = 'M05' THEN 'MSP - Managers'
ELSEIF [PERS_PGM] = 'MSP' and [CTO_FIX] != 'M10' THEN 'MSP - Senior Professionals'
ELSEIF [PERS_PGM] = 'PSS' and [Calculation_946318925060980737] != '4' THEN 'PSS - Non Students'
ELSEIF [PERS_PGM] = 'UNK' THEN 'PSS - Non Students'
END

// This code is used if the data has been extracted
IF [APPT_TYPE_CODE] = ' ' THEN [APPT_TYPE_CODE_PRI]
ELSE [APPT_TYPE_CODE]
END

