IF [FUND] = '69085' THEN 'Systemwide Assessment'
ELSEIF (RTRIM([FUND_GROUP_CODE]) = '401' OR RTRIM([FUND_GROUP_CODE]) = '402' OR RTRIM([FUND_GROUP_CODE]) = '40411' OR RTRIM([FUND_GROUP_CODE]) = '40311' OR RTRIM([FUND_GROUP_CODE]) = '40312' OR RTRIM([FUND_GROUP_CODE]) = '403141' OR RTRIM([FUND_GROUP_CODE]) = '403142' OR RTRIM([FUND_GROUP_CODE]) = '403143' OR RTRIM([FUND_GROUP_CODE]) = '403144' OR RTRIM([FUND_GROUP_CODE]) = '403145' OR RTRIM([FUND_GROUP_CODE]) = '403146' OR RTRIM([FUND_GROUP_CODE]) = '403147' OR RTRIM([FUND_GROUP_CODE]) = '403148' OR RTRIM([FUND_GROUP_CODE]) = '403149' OR RTRIM([FUND_GROUP_CODE]) = '40315' OR RTRIM([FUND_GROUP_CODE]) = '403151' OR RTRIM([FUND_GROUP_CODE]) = '403152' OR RTRIM([FUND_GROUP_CODE]) = '403153' OR RTRIM([FUND_GROUP_CODE]) = '4032') THEN 'Core Funds' ELSE 'Non-Core Funds' END

